debug.js
==========

在手机上打印调试信息。

### 快速上手
```javascript
debug.success("This is success message:)");
debug.error("This is error message:)");
debug.log("This is primary message:)");
debug.log({a: 1, b: 2});
debug.log([1,2,3]);
```

